import React from "react";
import './Movies.css';
import MoviesButton from '../../images/find-3.svg';


function Movies(props) {

  const movieRef = React.useRef();

  function handleSubmit(e) {
    e.preventDefault();

    const movie = movieRef.current.value;

    props.onGetMovie({
      movie: movie
    });

  }


  return (
    <div className='movies'>
      <div className='movies-conteiner'>

        <label className="movies__label">
          <input className="movies__checkbox" type='checkbox' />
          Короткометражки
        </label>
        <div className="line"></div>
      </div>
    </div>
  )
}

export default Movies;
